rds={{67.2,85.1,1453}},qgs={1748},r=2,sourceQuests={7495}},{i(18403,{b=1,f=52}),i(18406,{b=1,f=53}),i(18404,{b=1,f=51})})),q(7491,g({coords={{32,37.8,1454}},qgs={4949},r=1,sourceQuests={7490}},{i(18403,{b=1,f=52}),i(18404,{b=1,f=51}),i(18406,{b=1,f=53})})),q(7507,g({c={1,2},description="You get this quest by looting Foror's Compendium from bosses in Dire Maul.\n\nYou can also buy it on the Auction House for a hefty price!",maps={234},providers={{"i",18401}}},{i(18513,{b=1})})),q(7636,g({c=a5,coords={{47,24.48,1448}},cost={{"i",18708,1},{"i",18955,1},{"i",18953,1},{"i",18952,1},{"i",18954,1}},description="You must defeat the 4 demons listed below by yourself with no pet in order to complete this quest.",qgs={14524},sourceQuests={7633}},{n(14535,g({coords={{60.3,13.2,1452}},crs={14531},description="Kite him using Aspect of the Cheetah. Keep Serpent Sting on at all times and use Concussive Shot whenever he gets close. It is important to remain beyond 30 yards of the Demonic Doom, yet within range to use Arcane Shot so that he continues chasing you. If you rely completely on Serpent Sting for damage, he will break aggro and return to where he started. Once you apply Serpent Sting, count to 4, and apply it again before it wears off (the damage does stack). You will be able to see this by a 2nd damage listing \"Stinging Trauma\", which will continue to increase each time the sting is applied.\n\nBe sure to clear the area you plan on fighting so as to not get dazed by another NPC wandering by.\n\nLocated in Winterspring."},{i(18955,{b=4})})),n(14534,g({coords={{25.3,65.9,1428}},crs={14529},description="Use Concussive Shot/Serpent Sting to kite him down the road. You should know how long serpent sting lasts, use only one per trip down the road, more if you think you can risk it. As soon as it's worn off, drop an ice trap, let him stand in it, go to the other side, max range, and start again. If for whatever reason he breaks trap, you can use scatter shot, or use concussive shot to just keep kiting him in a circle until the cooldown finishes.\n\nDo not worry about his enrage, because he won't be touching you at all if you play right.\n\nLocated in the Burning Steppes."},{i(18953,{b=4})})),n(14533,g({coords={{34.5,41.1,1449}},crs={14527},description="There are two things that can make this fight difficult: her pet, a felhound named Precious and low nature resistance. Most hunters tend to CC Precious by freeze trapping it. Using ranged attacks is useless because she casts a debuff that substantially lowers ranged attack power. Your best bet is to use aspect of the wild + a greater nature protection potion (to dull and absorb her lightning bolts) and melee her until she falls.\n\nLocated in Ungoro Crater."},{i(18952,{b=4})})),n(14530,g({coords={{24.7,76,1451}},crs={14536},description="This is the hardest demon:\n\nStrengths:\n* He does NOT predictably chase you. He frequently stops to fear (disorienting you and causing around 800 damage also) or will stop to shoot homing beetles at you.\n* The homing beetles basically prevent you from bandaging. They move extremely slow but hit extremely hard\n* If you leave melee range (further than 2-3 range or so), he uses an instant cast fear spell that also does 700-800 damage instantly, and he can cast these quickly, almost seemingly chain casting. Shadow protection potions do absorb this damage, however, even with greater potions, he tears through them very fast. It's also likely that the fear will send you into the homing beetles\n* Seemingly unlimited mana bar, so Viper Sting is useless\n* Scorpid sting has very little/no effect on him\n* Melees extremely hard and fast (200+) when in normal form\n\nWeaknesses:\n* If you use Rank 3 Wing Clip on him, it immobilizes him completely with \"Crippling Clip\" for 30 seconds.\n* The homing missiles (creepings) are not fired when you remain in melee range\n* He does NOT cast his fear when you remain in melee range\n* Must be 'chilled' via Frost Trap prior 