ests={6661}},{i(17119,{f=55})}))})})),m(1426,g({description="Dun Morogh is a snowy region located between the magma-strewn wasteland of the Searing Gorge to the south, the gentle ridges of Loch Modan to the east, and the swampy Wetlands to the north. Dun Morogh is home to both the gnomes of Gnomeregan and the Ironforge dwarves and is the location of the major city of Ironforge. The Khaz Modan mountains surround Dun Morogh on all sides, making it accessible only by certain passes that are currently watched over by dwarven troops.\n\nThe center of dwarven culture and ingenuity, Dun Morogh holds the capital of Ironforge. The region is snow-swept and forested, with gray, craggy mountains and slinking wolves. Troggs recently overran Gnomeregan, the gnomes? former capital, and drove its citizens to Ironforge. Frostmane trolls menace dwarven patrols. Several villages and towns dot the landscape, and though the trade routes can be perilous, dwarven mountaineers and warriors keep their settlements safe."},{n(-15,{exp(803,{maphash="128:128:573:280"}),exp(801,{maphash="180:128:274:296"}),exp(804,{maphash="155:128:522:322"}),exp(134,{maphash="165:165:608:291"}),exp(808,{maphash="128:165:759:173"}),exp(136,{maphash="200:185:314:311"}),exp(132,{maphash="240:185:155:403"}),exp(137,{maphash="115:115:252:249"}),exp(135,{maphash="125:125:217:287"}),exp(809,{maphash="315:200:397:163"}),exp(211,{maphash="128:180:281:167"}),exp(800,{maphash="150:128:295:385"}),exp(131,{maphash="200:200:386:294"}),exp(133,{maphash="180:165:166:184"}),exp(806,{maphash="128:120:792:279"}),exp(212,{maphash="155:170:694:273"}),exp(802,{maphash="128:190:347:163"}),exp(138,{maphash="128:165:502:221"})}),n(-17,{q(319,{coords={{30.2,45.8,1426}},lvl=2,qgs={1374},r=2,sourceQuests={318}}),q(170,g({coords={{29.6,71.2,1426}},qgs={713},r=2,sourceQuests={179}},{i(6185,{b=1,f=3}),i(2172,{b=1,f=6}),i(6173,{b=1,f=4})})),q(417,g({coords={{79.7,36.2,1426}},cost={{"i",3117,1},{"i",3183,1}},lvl=8,providers={{"o",2059}},r=2,so