olcano crater. The crater teems with life, and features one of the Great Trees with a portal leading into the Emerald Dream. The sleeping druids' influence can be seen on the surrounding land, which is cloaked in a twilight quite different from the rest of Duskwood. The woods also feature several abandoned farmsteads, as well as the prominent Raven Hill Cemetery, which holds the graves of the numerous people who have been killed by wild beasts and undead since the darkness fell. "},{n(-15,{exp(492,{maphash="350:300:85:149"}),exp(121,{maphash="220:220:690:353"}),exp(1098,{maphash="200:175:653:120"}),exp(536,{maphash="275:250:55:342"}),exp(42,{maphash="315:280:631:162"}),exp(1097,{maphash="160:330:19:132"}),exp(241,{maphash="250:230:539:369"}),exp(856,{maphash="360:420:298:79"}),exp(245,{maphash="235:250:390:382"}),exp(799,{maphash="910:210:89:31"}),exp(93,{maphash="255:285:243:348"}),exp(94,{maphash="195:145:102:302"}),exp(242,{maphash="220:340:504:117"})}),n(-6,{fp(12,{coords={{77.6,44.4,1431}},crs={2409},r=2})}),n(-17,{q(231,g({cost={{"i",2162,1}},lvl=28,qgs={576},r=2},{i(2000,{b=1,f=26})})),q(337,{description="The item that starts this quest can drop from most of the mobs in the zone, but seem to drop more often from the Worgen.",lvl=20,maps=a13,providers={{"i",2794}},r=2}),q(1044,g({coords={{75.3,49.2,1431}},lvl=25,qgs={661},r=2,sourceQuests={1043}},{i(5817,{b=1,f=32}),i(5818,{b=1,f=27})})),q(325,{coords={{51.8,12.1,1453}},cost={{"i",7297,1}},lvl=20,qgs={1416},r=2,sourceQuests={322}}),q(322,{coords={{10.6,60.5,1437}},cost={{"i",2712,1}},lvl=20,maps={1437},qgs={1217},r=2,sourceQuests={324,526}}),q(253,g({coords={{71.9,46.5,1431}},cost={{"i",2382,1}},lvl=20,qgs={263},r=2},{i(2382,{b=4,coords={{28.8,31.2,1431}},crs={314},questID=253}),i(3560,{b=1,f=4}),i(6223,{b=1,f=8})})),q(157,{coords={{75.8,45.3,1431}},cost={{"i",1596,1}},lvl=20,qgs={265},r=2,sourceQuests={154}}),q(164,{coords={{75.3,48.7,1431}},cost={{"i",1922,1}},isBreadcrumb=1,lvl=17,qgs={633},r=2}),q(254,{alt