airly flat to hilly, and is nestled among even taller mountains. The forest is eerily silent save for the occasional unnatural howling echoing among the trees. Mossy overhangs shiver in the cold breeze, and the trees are all sickly or dying. Dilapidated farmsteads and abandoned mines dot the land, home now to the darker denizens of the woods.\n\nThis woodland is haunted and wild, characterized by its tall, silver-barked pines towering over grassy knolls. The Alliance once protected Silverpine Forest when it was verdant and lively. Now the place is shrouded in ghostly mists. Forsaken control the northern forest[ and constantly clash with the wretched Rot Hide tribe of gnolls. What remains of the human population retains control of the southern forest, but they are desperate and their forces thinly stretched. Dalaran sends frequent expeditions into Silverpine to defend these people and study the undead plague and worgen curse ? a mysterious affliction that causes its victims to transform into bloodthirsty, lycanthropic worgen when the moon rises."},{n(-15,{exp(927,{maphash="256:220:459:13"}),exp(238,{maphash="256:160:465:0"}),exp(229,{maphash="165:185:382:252"}),exp(172,{maphash="250:215:593:74"}),exp(233,{maphash="240:240:494:262"}),exp(204,{maphash="140:125:391:446"}),exp(237,{maphash="180:185:457:144"}),exp(230,{maphash="210:215:379:447"}),exp(928,{maphash="180:128:323:128"}),exp(231,{maphash="240:180:491:417"}),exp(228,{maphash="210:160:352:168"}),exp(213,{maphash="160:170:470:261"}),exp(226,{maphash="185:165:286:37"}),exp(240,{maphash="175:165:402:65"}),exp(236,{maphash="220:160:364:359"})}),n(-6,{fp(10,{coords={{45.6,42.6,1421}},crs={2226},r=1})}),n(-17,{q(530,g({coords={{62,43,1458}},cost={{"i",3613,1}},lvl=10,maps=a16,qgs={2050},r=1,sourceQuests={441}},{i(3613,{b=4,coords={{46.4,84.6,1421}},crs={2332},questID=530,sourceQuests={441}}),i(3235,{b=1,f=52})})),q(447,g({coords={{42.8,40.8,1421}},cost={{"i",3253,6},{"i",3254,6}},lvl=9,qgs={1937},r=1},{i(3448,{f=55})}