tinsert(l,n(-538,g({description="When Phase 5 is eventually released, the Ruins of Ahn'Qiraj and Temple of Ahn'Qiraj will not be immediately available. Instead, server communities will have to undertake a massive war effort to open the raids by gathering supplies to prepare for the war and completing an epic questline that ultimately culminates in the banging of a gong to open the gates and release the horrors within upon the world.\n\nOnce both factions have finished their contribution, there is a 5-day grace period where. Afterwards, there is a server-wide 10 hour event which spans several zones in Kalimdor the moment someone bangs the gong.\n\nHow quickly Ahn'Qiraj opens depends on the server and its faction balance.\n\nWe recommend delaying the War Effort as long as possible to allow for the most number of people to obtain the Scarab Lord mount as everyone that finishes The Scepter of the Shifting Sands quest line will be granted the same rewards!",maps={1454,1455},u=1501},{n(-30,g({r=2,u=1501},{q(8811,{coords={{55.2,64.7,1453},{59.3,64.1,1455}},cost={{"i",21436,1}},description="Grants 5 reputation with Stormwind",qgs={15735,15766},r=2,repeatable=1,u=1501}),q(8830,{coords={{55.2,64.7,1453},{59.3,64.1,1455}},cost={{"i",21436,1}},description="Grants 5 reputation with Stormwind",qgs={15735,15766},r=2,repeatable=1,sourceQuests={8811},u=1501}),q(8812,{coords={{43.2,46.5,1455},{61,77.1,1455}},cost={{"i",21436,1}},description="Grants 5 reputation with Ironforge",qgs={15734,15764},r=2,repeatable=1,u=1501}),q(8834,{coords={{43.2,46.5,1455},{61,77.1,1455}},cost={{"i",21436,1}},description="Grants 5 reputation with Ironforge",qgs={15734,15764},r=2,repeatable=1,sourceQuests={8812},u=1501}),q(8813,{coords={{38.2,38.7,1457},{59.1,65.5,1455}},cost={{"i",21436,1}},description="Grants 5 reputation with Darnassus",qgs={15731,15762},r=2,repeatable=1,u=1501}),q(8836,{coords={{38.2,38.7,1457},{59.1,65.5,1455}},cost={{"i",21436,1}},description="Grants 5 reputation with Darnassus",qgs