tinsert(l,n(-539,g({description="In addition to all players on a realm working towards completing the War Effort, one player had to create the Scepter of the Shifting Sands - a very difficult task that could only be solved by a server's top guild back when the questline was added. After the war effort was finished and the army of the Alliance and the Horde arrived in Silithus, the Scepter of the Shifting Sands could be used on the Scarab Gong. Doing so resulted in the opening of Ahn'Qiraj. The first player to bang the Scarab Gong on each server would be rewarded with the Scarab Lord title (in Burning Crusade, the title will not be available in Classic!) and the Black Qiraji Resonating Crystal mount. Anyone else who followed them within 10 hours was rewarded with the title as well.\n\nAlthough it is still possible to complete the questline for the Scepter of the Shifting Sands after the gates have been opened on your server, doing so will not reward neither the Black Qiraji Resonating Crystal nor the Scarab Lord title.",lvl=60,maps=a40,u=15},{n(-17,g({u=15},{q(8519,{coords={{28.7,89.1,1451}},minReputation=a19,providers={{"o",180633}},sourceQuests={8305},u=15}),q(8303,{coords={{49.5,36.4,1451}},cost={{"i",20415,1}},minReputation=a19,qgs={15180},sourceQuests={8301},u=15}),q(8575,{coords={{57,85.6,1447}},providers={{"i",20949}},qgs={15481},sourceQuests={8555},u=15}),q(8743,g({coords={{25.7,90.9,1451}},cost={{"i",21175,1}},providers={{"o",180717}},sourceQuests={8742},u=1502},{i(21176,{b=1,f=100,u=1502})})),q(8606,g({coords={{65.2,18.6,1446}},crs={15554},qgs={11811},sourceQuests={8598},u=15},{i(21042,g({b=1,u=15},{i(21037,{b=1,questID=8606,sourceQuests={8598},u=15}),i(21039,{b=1,questID=8606,u=15}),i(21040,{b=1,f=2,questID=8606,u=15}),i(21041,{b=1,coords={{65,72,1452}},questID=8606,u=15})}))})),q(8597,{coords={{65.2,18.6,1446}},qgs={11811},sourceQuests={8576},u=15}),q(8586,g({coords={{52.6,28.1,1446}},cost={{"i",9061,20},{"i",8150,20}},qgs={8125},sourceQuests={8585},u=15}