tinsert(l,n(-540,g({description="The Scourge Invasion was a world event in Patch 1.11 that heralded the opening of Naxxramas, the citadel of the dreaded Kel'Thuzad.\n\nSeveral regions of Azeroth came under attack by Scourge forces. Members of the Argent Dawn organized a worldwide counter to the Scourge invasion, keeping an eye out for any necropolis sightings and passing on their information to all adventurers willing to aid them in their struggle.\n\nWith each victory against the Scourge, the defense grows stronger. As more and more invasion attempts are beaten back by the defenders, the Argent Dawn will be able to bestow increasingly more powerful blessings upon those fighting the invaders. If the mortal races focus on clearing the Scourge camps all over the world that have sprung up beneath each necropolis, perhaps the invasion can effectively be halted or even repelled. Those who wish to take up arms against the undead invaders should speak with a representative of the Argent Dawn to learn what regions need help and how the defense is holding up.",maps={1419,1423,1428,1446,1447,1452},u=1601},{n(-17,g({u=1601},{q(9094,g({coords={{54.3,62.8,1453},{34,66.4,1455},{42.6,53.4,1456},{53.4,73.4,1454},{49.6,30,1458},{64.5,42.8,1457},{80.8,59.5,1423}},cost={{"i",22484,30}},lvl=50,qgs={16787},repeatable=1,sourceQuests={9153},u=1601},{i(23084,{b=1,f=4,u=1601}),i(23081,{b=1,f=5,u=1601}),i(23082,{b=1,f=6,u=1601}),i(23078,{b=1,f=7,u=1601})})),q(9333,g({coords={{54.3,62.8,1453},{34,66.4,1455},{42.6,53.4,1456},{53.4,73.4,1454},{49.6,30,1458},{64.5,42.8,1457},{80.8,59.5,1423}},cost={{"i",22484,30}},lvl=50,qgs={16787},repeatable=1,sourceQuests={9094},u=1601},{i(23084,{b=1,f=4,u=1601}),i(23081,{b=1,f=5,u=1601}),i(23082,{b=1,f=6,u=1601}),i(23078,{b=1,f=7,u=1601})})),q(9334,g({coords={{54.7,62.2,1453},{34,66.4,1455},{43.7,52.6,1456},{52.5,73.7,1454},{49.9,29.4,1458},{64.3,44.5,1457},{80.9,59.6,1423}},cost={{"i",22484,8}},lvl=50,qgs={16786},repeatable=1,sourceQuests={9153},u=1601},{i(